var tipuesearch = {"pages": [{'title': '計算機程式', 'text': '計算機課程網頁: http://mde.tw/cp2019 \n Dartpad: https://dartpad.dev?id=68e451e4dcf5606a168856fdeca353d7 \xa0 \n My Dartpad: http://mde.tw/dartpad/?id=68e451e4dcf5606a168856fdeca353d7 \n 哈囉程式 \n \n 原始碼: \n void main() {\n   print("哈囉!");\n} \n sum程式 \n 原程式碼: \n int i;\nint sum;\n\nmain(){\n  sum = 0;\n  for(i=1;i <= 10 ;i++){\n    sum += i;\n    print("$sum");\n  }\n  print(\'sum = $sum\');\n}\n \n sum程式 \n \n 倉儲: https://gist.github.com/40823237', 'tags': '', 'url': '計算機程式.html'}, {'title': 'USB', 'text': '', 'tags': '', 'url': 'USB.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};